-- ----------------------------
--  Table structure for hs_categorias
-- ----------------------------
DROP TABLE IF EXISTS hs_categorias;
CREATE TABLE hs_categorias (
  category_id serial,
  category_parent int DEFAULT NULL,
  category_title varchar(255) DEFAULT NULL,
  category_url varchar(255) DEFAULT NULL,
  category_content text,
  category_date timestamp DEFAULT NULL,
  category_tags varchar(255) DEFAULT NULL,
  category_tipo varchar(255) DEFAULT NULL,
  category_views decimal(10,0) DEFAULT NULL,
  category_last_views timestamp DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (category_id)
);

-- ----------------------------
--  Table structure for hs_cidades
-- ----------------------------
DROP TABLE IF EXISTS hs_cidades;
CREATE TABLE hs_cidades (
  cidade_id serial,
  estado_id int DEFAULT NULL,
  cidade_nome varchar(75)DEFAULT NULL,
  cidade_uf varchar(5) DEFAULT NULL,
  PRIMARY KEY (cidade_id)
);

-- ----------------------------
--  Table structure for hs_cursos_videos
-- ----------------------------
DROP TABLE IF EXISTS hs_cursos_videos;
CREATE TABLE hs_cursos_videos (
  video_id serial,
  curso_id int DEFAULT NULL,
  post_title varchar(255) DEFAULT NULL,
  post_url varchar(255) DEFAULT NULL,
  post_content text ,
  post_status int DEFAULT NULL,
  post_last_views timestamp DEFAULT CURRENT_TIMESTAMP,
  post_date timestamp DEFAULT NULL,
  post_type varchar(255) DEFAULT NULL,
  post_views decimal(10,0) DEFAULT 0,
  PRIMARY KEY (video_id)
);

-- ----------------------------
--  Table structure for hs_empresas
-- ----------------------------
DROP TABLE IF EXISTS hs_empresas;
CREATE TABLE hs_empresas (
  empresa_id serial,
  empresa_title varchar(255) DEFAULT NULL,
  empresa_name varchar(255) DEFAULT NULL,
  empresa_capa varchar(255) DEFAULT NULL,
  empresa_ramo varchar(255) DEFAULT NULL,
  empresa_sobre text,
  empresa_site varchar(255) DEFAULT NULL,
  empresa_facebook varchar(255) DEFAULT NULL,
  empresa_endereco varchar(255) DEFAULT NULL,
  empresa_uf int DEFAULT NULL,
  empresa_cidade int DEFAULT NULL,
  empresa_categoria varchar(255) DEFAULT NULL,
  empresa_status int DEFAULT '0',
  empresa_views decimal(10,0) DEFAULT NULL,
  empresa_date timestamp NULL DEFAULT NULL,
  empresa_last_view timestamp default CURRENT_TIMESTAMP,
  PRIMARY KEY (empresa_id)
);

-- ----------------------------
--  Table structure for hs_estados
-- ----------------------------
DROP TABLE IF EXISTS hs_estados;
CREATE TABLE hs_estados (
  estado_id serial,
  estado_nome varchar(75) DEFAULT NULL,
  estado_uf varchar(5) DEFAULT NULL,
  estado_regiao varchar(75) DEFAULT NULL,
  PRIMARY KEY (estado_id)
);

-- ----------------------------
--  Table structure for hs_posts
-- ----------------------------
DROP TABLE IF EXISTS hs_posts;
CREATE TABLE hs_posts (
  post_id serial,
  post_cover varchar(255) DEFAULT NULL,
  post_title varchar(255) DEFAULT NULL,
  post_url varchar(255) DEFAULT NULL,
  post_content text,
  post_tags text,
  post_category int DEFAULT NULL,
  post_cat_parent int DEFAULT NULL,
  post_estado varchar(255) DEFAULT NULL,
  post_cidade varchar(255) DEFAULT NULL,
  post_author int DEFAULT NULL,
  post_status int DEFAULT NULL,
  post_last_views timestamp DEFAULT CURRENT_TIMESTAMP,
  post_date timestamp DEFAULT NULL,
  post_type varchar(255) DEFAULT NULL,
  post_views decimal(10,0) DEFAULT 0,
  post_nivel varchar(255) DEFAULT NULL,
  post_author_postagem varchar(255) DEFAULT NULL,
  PRIMARY KEY (post_id)
);

-- ----------------------------
--  Table structure for hs_posts_gallery
-- ----------------------------
DROP TABLE IF EXISTS hs_posts_gallery;
CREATE TABLE hs_posts_gallery (
  post_id int,
  gallery_id serial,
  gallery_image varchar(255) DEFAULT NULL,
  gallery_date timestamp DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (gallery_id)
);

-- ----------------------------
--  Table structure for hs_siteviews
-- ----------------------------
DROP TABLE IF EXISTS hs_siteviews;
CREATE TABLE hs_siteviews (
  siteviews_id serial,
  siteviews_date timestamp default now(),
  siteviews_users decimal(10,0) NOT NULL,
  siteviews_views decimal(10,0) NOT NULL,
  siteviews_pages decimal(10,0) NOT NULL,
  PRIMARY KEY (siteviews_id)
);

-- ----------------------------
--  Table structure for hs_siteviews_agent
-- ----------------------------
DROP TABLE IF EXISTS hs_siteviews_agent;
CREATE TABLE hs_siteviews_agent (
  agent_id serial,
  agent_capa varchar(255) DEFAULT NULL,
  agent_name varchar(255) NOT NULL,
  agent_views decimal(10,0) NOT NULL,
  agemte_last_views timestamp DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (agent_id)  
);

-- ----------------------------
--  Table structure for hs_siteviews_online
-- ----------------------------
DROP TABLE IF EXISTS hs_siteviews_online;
CREATE TABLE hs_siteviews_online (
  online_id serial,
  online_session varchar(255) NOT NULL,
  online_startview timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  online_endview timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  online_ip varchar(255) NOT NULL,
  online_url varchar(255) NOT NULL,
  online_agent varchar(255) NOT NULL,
  agent_name varchar(255) DEFAULT NULL,
  PRIMARY KEY (online_id)
);

-- ----------------------------
--  Table structure for hs_users
-- ----------------------------
DROP TABLE IF EXISTS hs_users;
CREATE TABLE hs_users (
  user_id serial,
  user_name varchar(255) NOT NULL,
  user_lastname varchar(255) NOT NULL,
  user_email varchar(255) NOT NULL,
  user_pass varchar(255) NOT NULL,
  user_code varchar(255) NOT NULL,
  user_registration timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  user_lastupdate timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  user_level int NOT NULL DEFAULT 1,
  user_siteurl varchar(255) NOT NULL,
  PRIMARY KEY (user_id)
);

